import React from 'react';
import { 
    Row, 
    Card, 
    CardImg, 
    CardTitle, 
    CardBody, 
    CardText, 
    CardSubtitle, 
    Col, 
    Container
  } from 'reactstrap';

function PaginationComponent(){
    return(
        <Container>
        <Row>
          <Col xs="4"></Col>
          <Col xs="4">
          <div className="pagination">
            <a href="#">&laquo;</a>
            <a href="#">1</a>
            <a href="#" className="active">2</a>
            <a href="#">3</a>
            <a href="#">&raquo;</a>
          </div>
          </Col>
          <Col xs="4"></Col>
        </Row>
      </Container>
    );
}

export default PaginationComponent;
